import s from './Messages.module.css'

let Message = (props) => {
    return (
        <div className={s.item}>
            {props.message}
        </div>
    )
}
const Messages = () => {
    return (
        <div className={s.items}>
            <Message message={'Hello, World'} />
            <Message message={'YO'} />
            <Message message={'Poshel nahoy'} />
        </div>
    );
};

export default Messages;
